import React from 'react';
import FilterLink from '../containers/FilterLink';
import { VisibilityFilters } from '../actions';

const Footer = () => (
  <div>
    <span>Show: </span>
    <FilterLink filter={VisibilityFilters.SHOW_ALL}>All</FilterLink>
    <FilterLink filter={VisibilityFilters.BRACELETS_ONLY}>Bracelets</FilterLink>
    <FilterLink filter={VisibilityFilters.NECKLACES_ONLY}>Necklaces</FilterLink>
    <FilterLink filter={VisibilityFilters.EARRINGS_ONLY}>Earrings</FilterLink>
  </div>
);

export default Footer;
